import React, { Component } from "react";
 
class Contact extends Component {
  render() {
    return (
        function validateForm() {
            var x = document.forms["myForm"]["fname"].value;
            if (x == "") {
              alert("Name must be filled out");
              return false;
            }
          }
    );
  }
}
 
export default Contact;
